import React from "react";

const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
      <h1>{props.part1}</h1>
      <h1>{props.part2}</h1>
      <h1>{props.part3}</h1>
    </div>
  );
};

const Content = (props) => {
  return (
    <div>
      <h3>Course name and exercises: {props.part1}</h3>
    </div>
  );
};

const Total = (props) => {
  return (
    <div>
      <h1>{props.total}</h1>
    </div>
  );
};

const App = () => {
  const course = "Half Stack application development";

  const part1 = {
    title: "Fundamentals of React",
    exercises1: 10,
  };
  const part2 = {
    title: "Using props to pass data",
    exercises2: 7,
  };
  const part3 = {
    title: "State of a component",
    exercises3: 14,
  };

  const total = part1.exercises1 + part2.exercises2 + part3.exercises3;

  return (
    <div>
      <Header course={course} />
      <Content part1={part1} />
      <Content />
      <Total />
    </div>
  );
};

export default App;
